def stationarity(indexs, data_in):

    total_gene_list = []
    gene_list_len = []
    number_of_segments = 40000
    for strain in indexs:
        count = 1
        strain_acc = []
        for x in range(1, len(strain)):
            if count % 2 == 0:
                for y in range(int(abs(strain[x]) - abs(strain[x - 1]))):
                    strain_acc.append(1)
            else:
                for y in range(int(abs(strain[x]) - abs(strain[x - 1]))):
                    strain_acc.append(0)
            count += 1


        def chunks_even_segment(l, n):
            return [l[i * n:(i + 1) * n] for i in range((len(l) + n - 1) // n)]

        def chunks(l, n):
           """Yield n number of sequential chunks from l."""
           d, r = divmod(len(l), n)
           for i in range(n):
               si = (d + 1) * (i if i < r else r) + d * (0 if i < r else i - r)
               yield l[si:si + (d + 1 if i < r else d)]

        genome_length = len(strain_acc)
        split_list = chunks_even_segment(strain_acc[:(40000 - ((genome_length // 127) - 40000)) * 127], 127)
        if (40000 - ((genome_length // 127) - 40000)) * 127 != genome_length:
            remaining_chunks = ((genome_length // 127)) - 40000
            second_half_of_split_list = chunks(strain_acc[(40000 - ((genome_length // 127) - 40000)) * 127:], remaining_chunks)
            final_second_half_of_split_list = []
            for element in second_half_of_split_list:
                final_second_half_of_split_list.append(element)
            split_list = split_list + final_second_half_of_split_list

        gene_list = []
        for element in split_list:
            ticker = 0
            for unit in element:
                if unit == 1:
                    ticker += 1
            gene_list.append(float(ticker / len(element)))

        total_gene_list.append(gene_list)
        gene_list_len.append(len(gene_list))


    min_segements = min(gene_list_len)
    rearranged_gene_list = []
    for x in range(min_segements):
        temp_list = []
        for gene_list in total_gene_list:
            temp_list.append(gene_list[x])
        rearranged_gene_list.append(temp_list)

    stationary = []
    stationary_areas = []
    count = 0
    not_stationary_index = []
    not_stationary_ticker = 0

    for element in rearranged_gene_list:
        if statistics.stdev(element) <= 0.33 or count in [x for x in range(40000 - 40, 40000)]:
            stationary_areas.append(count)
            not_stationary_ticker = 0
        else:
            not_stationary_index.append(count)
            not_stationary_ticker += 1
        for tick in range(1):
            stationary.append(element[-1])
        count += 1
    print("left to forecast")
    print(number_of_segments - len(stationary_areas))
    print(number_of_segments * 0.33)
    last_stationary = all_indexs[-1]
    return last_stationary, stationary_areas, stationary


